import{_ as t,o,c as a,ag as r}from"./chunks/framework.BRz7bqS8.js";const h=JSON.parse('{"title":"Import & Export","description":"","frontmatter":{},"headers":[],"relativePath":"guide/import-export.md","filePath":"guide/import-export.md"}'),i={name:"guide/import-export.md"};function s(l,e,n,p,d,m){return o(),a("div",null,[...e[0]||(e[0]=[r('<h1 id="import-export" tabindex="-1">Import &amp; Export <a class="header-anchor" href="#import-export" aria-label="Permalink to &quot;Import &amp; Export&quot;">​</a></h1><p>OpenBin can export your location&#39;s data for backup or migration, and import data from a previous export or a supported external format.</p><h2 id="export" tabindex="-1">Export <a class="header-anchor" href="#export" aria-label="Permalink to &quot;Export&quot;">​</a></h2><p>Go to <strong>Settings → Data</strong> to access export options. Exports always include all bins in the currently active location.</p><h3 id="json-export" tabindex="-1">JSON Export <a class="header-anchor" href="#json-export" aria-label="Permalink to &quot;JSON Export&quot;">​</a></h3><p>Downloads a structured JSON file (<code>openbin-backup-YYYY-MM-DD.json</code>) containing:</p><ul><li>All bins (name, items, tags, notes, icon, color, card style, short code, area, visibility, timestamps)</li><li>Photos embedded as base64 strings inside each bin&#39;s data</li></ul><p>JSON is the recommended format for full-fidelity backups. It preserves all metadata and photos.</p><h3 id="zip-export" tabindex="-1">ZIP Export <a class="header-anchor" href="#zip-export" aria-label="Permalink to &quot;ZIP Export&quot;">​</a></h3><p>Downloads a ZIP archive (<code>openbin-export-YYYY-MM-DD.zip</code>) containing:</p><ul><li>A JSON file with all bin data</li><li>Original photo files in their native format (JPEG, PNG, etc.)</li></ul><p>ZIP is preferable when you want to preserve original photo quality without base64 encoding overhead.</p><h3 id="csv-export" tabindex="-1">CSV Export <a class="header-anchor" href="#csv-export" aria-label="Permalink to &quot;CSV Export&quot;">​</a></h3><p>Downloads a spreadsheet-compatible CSV file (<code>openbin-bins-YYYY-MM-DD.csv</code>) with one row per bin:</p><ul><li>Bin name, area, items (comma-separated within the cell), tags, notes</li></ul><p>CSV does not include photos or card style settings. Use it when you need to open your inventory in a spreadsheet application.</p><h2 id="import" tabindex="-1">Import <a class="header-anchor" href="#import" aria-label="Permalink to &quot;Import&quot;">​</a></h2><p>Go to <strong>Settings → Data → Import</strong> and drag-and-drop a file or click to select one.</p><h3 id="supported-import-formats" tabindex="-1">Supported Import Formats <a class="header-anchor" href="#supported-import-formats" aria-label="Permalink to &quot;Supported Import Formats&quot;">​</a></h3><h4 id="v2-json-current-format" tabindex="-1">V2 JSON (current format) <a class="header-anchor" href="#v2-json-current-format" aria-label="Permalink to &quot;V2 JSON (current format)&quot;">​</a></h4><p>Full-fidelity import. Restores:</p><ul><li>Bin name, items, tags, notes, icon, color, card style</li><li>Photos (re-attached from embedded base64 data)</li><li>Short codes are re-generated to avoid conflicts with existing bins</li></ul><h4 id="v1-json-legacy-format" tabindex="-1">V1 JSON (legacy format) <a class="header-anchor" href="#v1-json-legacy-format" aria-label="Permalink to &quot;V1 JSON (legacy format)&quot;">​</a></h4><p>The older export format used freeform <code>contents</code> strings instead of discrete items. When importing V1:</p><ul><li>The <code>contents</code> field is imported as the bin&#39;s <strong>notes</strong>.</li><li>Tags and timestamps are preserved.</li></ul><h4 id="zip" tabindex="-1">ZIP <a class="header-anchor" href="#zip" aria-label="Permalink to &quot;ZIP&quot;">​</a></h4><p>Import a ZIP file exported from OpenBin. The importer reads the JSON inside the ZIP and re-attaches the bundled photos.</p><h3 id="import-behavior" tabindex="-1">Import Behavior <a class="header-anchor" href="#import-behavior" aria-label="Permalink to &quot;Import Behavior&quot;">​</a></h3><ul><li>Import <strong>creates new bins</strong> — it does not overwrite or merge with existing bins.</li><li>Bins are imported into the <strong>currently active location</strong>.</li><li>Short codes are re-generated for all imported bins.</li><li>If a photo fails to import (e.g. unsupported format or size limit exceeded), the bin is still imported without that photo and the failure is reported in the results summary.</li></ul><h3 id="import-results" tabindex="-1">Import Results <a class="header-anchor" href="#import-results" aria-label="Permalink to &quot;Import Results&quot;">​</a></h3><p>After import completes, OpenBin shows a summary:</p><ul><li>Bins imported successfully</li><li>Bins skipped (if any)</li><li>Photos imported</li><li>Photos skipped</li></ul><h3 id="file-size-limit" tabindex="-1">File Size Limit <a class="header-anchor" href="#file-size-limit" aria-label="Permalink to &quot;File Size Limit&quot;">​</a></h3><p>The maximum import file size is <strong>100 MB</strong>. For larger collections, split the export into multiple files.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Always export a backup before importing. Imports cannot be bulk-undone — you would need to manually delete the imported bins or use bulk delete.</p></div>',35)])])}const u=t(i,[["render",s]]);export{h as __pageData,u as default};
